Diagnosis. Male with scutum mostly granulated; posterior surface of propodeum not sculptured by two longitudinal keels; distal apex of paramere broadly hollowed out (
Fig. 1
).

Description. Male : fully winged; length 2.7 mm . Head black, except mandible testaceous; antenna brown, except segment 1 testaceous; mesosoma black; metasoma brown; legs testaceous, except clubs of profemora partly brown, mesotibiae partly brown, metacoxae, clubs of metafemora and metatibiae partly black. Antenna hairy, filiform, with segment 3 triangular; antennal segments in following proportions: 10 : 6 : 6 : 5 : 5 : 5 : 5 : 5 : 6 : 8 . Head dull, granulated and reticulate rugose; frontal line complete; face with two lateral keels around orbits directed towards antennal toruli; vertex with two hardly visible oblique keels connecting posterior ocelli to occipital carina; occipital carina complete; POL = 9 ; OL = 5 ; OOL = 6 ; OPL = 5 ; TL = 4 ; greatest breadth of posterior ocelli about as long as TL. Scutum dull, granulated, except anterior margin rugose. Notauli incomplete, reaching about 0.25 length of scutum. Scutellum and metanotum shiny, smooth, punctate, without sculpture among punctures. Propodeum reticulate rugose, with strong transverse keel between dorsal and posterior surface; posterior surface without longitudinal keels. Fore wing hyaline, without dark transverse bands; distal part of stigmal vein shorter than proximal part ( 2 : 8 ). Paramere with distal apex broadly hollowed out, without distal inner pointed process (
Fig. 1
). Tibial spurs 1 / 1 / 2 . Female : unknown.
